import { hash } from "bcryptjs";
import chai from "chai";
import chaiHttp from "chai-http";

import { prisma } from "../../../database/prismaClient";
import { app } from "../../../server";

chai.use(chaiHttp);
const { request, expect } = chai;

describe("Test /auth/login endpoint", () => {
  const username = "joao";
  const password = "1234567A";
  const invalidUsername = "pedro";
  const invalidPassword = "A1234567";

  before(async () => {
    await prisma.users.create({
      data: {
        username,
        password: await hash(password, 8),
        account: {
          create: {
            balance: 100,
          },
        },
      },
    });
  });
  after(async () => {
    await prisma.users.deleteMany();
  });

  it("Valid user should return token and 200", async () => {
    const response = await request(app)
      .post("/auth/login")
      .send({ username, password });
    expect(response).to.have.status(200);
    expect(response.body).to.have.property("token");
  });

  it("Invalid user schema should return error message and 400", async () => {
    const response = await request(app).post("/auth/login").send({ username });
    expect(response).to.have.status(400);
    expect(response.body).to.have.property("message");
    expect(response.body.message).to.eq("Invalid user schema");
  });

  it("Usename with less than 3 character should return error message and 400", async () => {
    const response = await request(app)
      .post("/auth/login")
      .send({ username: "as", password });
    expect(response).to.have.status(400);
    expect(response.body).to.have.property("message");
    expect(response.body.message).to.eq("Invalid user schema");
  });

  it("Password without number should return error message and 400", async () => {
    const response = await request(app)
      .post("/auth/login")
      .send({ username, password: "asddaAsdadawead" });
    expect(response).to.have.status(400);
    expect(response.body).to.have.property("message");
    expect(response.body.message).to.eq("Invalid user schema");
  });

  it("Password without uppercase letter should return error message and 400", async () => {
    const response = await request(app)
      .post("/auth/login")
      .send({ username, password: "asdda2sdadawead" });
    expect(response).to.have.status(400);
    expect(response.body).to.have.property("message");
    expect(response.body.message).to.eq("Invalid user schema");
  });

  it("Password with less than 8 characters hould return error message and 400", async () => {
    const response = await request(app)
      .post("/auth/login")
      .send({ username, password: "aasd2A" });
    expect(response).to.have.status(400);
    expect(response.body).to.have.property("message");
    expect(response.body.message).to.eq("Invalid user schema");
  });

  it("Invalid password should error message and 401", async () => {
    const response = await request(app)
      .post("/auth/login")
      .send({ username, password: invalidPassword });
    expect(response).to.have.status(401);
    expect(response.body).to.have.property("message");
    expect(response.body.message).to.eq("Invalid user or password");
  });
  it("Invalid user should error message and 401", async () => {
    const response = await request(app)
      .post("/auth/login")
      .send({ username: invalidUsername, password });
    expect(response).to.have.status(401);
    expect(response.body).to.have.property("message");
    expect(response.body.message).to.eq("Invalid user or password");
  });
});

import cors from "cors";
import express from "express";
import swaggerUi from "swagger-ui-express";

import "express-async-errors";
import { errorMiddleware } from "./errors/errorMiddleware";
import routes from "./routes";

// eslint-disable-next-line @typescript-eslint/no-var-requires
const swaggerFile = require("../swagger.json");

const PORT = process.env.PORT || 3008;

export const app = express();
app.use(express.json());
app.use(cors());

app.use("/api-docs", swaggerUi.serve, swaggerUi.setup(swaggerFile));
app.use(routes);

app.use(errorMiddleware);
app.listen(PORT, () => console.log(`Running on Port: ${PORT}`));

import { ErrorRequestHandler } from "express";

import { AppError } from "./AppError";

// eslint-disable-next-line @typescript-eslint/no-unused-vars
export const errorMiddleware: ErrorRequestHandler = (err, _req, res, _next) => {
  if (err instanceof AppError) {
    return res.status(err.statusCode).json({ message: err.message });
  }
  console.error(err);
  return res.status(500).json({ message: "Server error" });
};

export class AppError {
  constructor(public statusCode: number, public message: string) {}
}

import { Router } from "express";

import { ensureAuthenticated } from "./middleware/ensureAuthenticated";
import { CreateTransactionUseController } from "./modules/useCases/createTransaction/CreateTransactionController";
import { CreateUserController } from "./modules/useCases/createUser/CreateUserController";
import { GetTransactionsController } from "./modules/useCases/getTransactions/GetTransacrionsController";
import { GetUserController } from "./modules/useCases/getUser/GetUserController";
import { LoginUserController } from "./modules/useCases/loginUser/LoginUserController";

const createUserController = new CreateUserController();
const loginUserController = new LoginUserController();
const getUserController = new GetUserController();
const createTransactionUseController = new CreateTransactionUseController();
const getTransactionsController = new GetTransactionsController();

const routes = Router();

routes.post("/auth/signup", createUserController.handle);
routes.post("/auth/login", loginUserController.handle);
routes.get("/auth/me", ensureAuthenticated, getUserController.handle);
routes.get(
  "/transaction",
  ensureAuthenticated,
  getTransactionsController.handle
);
routes.post(
  "/transaction",
  ensureAuthenticated,
  createTransactionUseController.handle
);

export default routes;

import { NextFunction, Request, Response } from "express";
import { verify } from "jsonwebtoken";

import { AppError } from "../errors/AppError";

interface IToken {
  username: string;
  accountId: string;
}

export function ensureAuthenticated(
  req: Request,
  _res: Response,
  next: NextFunction
) {
  const authToken = req.headers.authorization;
  if (!authToken) throw new AppError(401, "Token is missing");

  const [, token] = authToken.split(" ");

  try {
    const decryptedToken = verify(
      token,
      process.env.JWT_SECRET as string
    ) as IToken;

    req.username = decryptedToken.username;
    req.accountId = decryptedToken.accountId;

    return next();
  } catch (err) {
    throw new AppError(401, "Invalid token");
  }
}

import { Request, Response } from "express";

import { CreateTransactionUseCase } from "./CreateTransactionUseCase";

export class CreateTransactionUseController {
  async handle(req: Request, res: Response) {
    const { creditUsername, transactionValue } = req.body;
    const createTransactionUseCase = new CreateTransactionUseCase();
    await createTransactionUseCase.execute({
      creditUsername,
      transactionValue,
      debitedAccountId: req.accountId as string,
    });
    res.status(201).json({ message: "Transaction was sucessfully created" });
  }
}

import { prisma } from "../../../database/prismaClient";
import { AppError } from "../../../errors/AppError";
import {
  CreateTransactionSchema,
  ICreateTransactionDTO,
} from "../../dtos/ICreateTransactionDTO";

export class CreateTransactionUseCase {
  async execute({
    debitedAccountId,
    creditUsername,
    transactionValue,
  }: ICreateTransactionDTO) {
    const parsed = CreateTransactionSchema.safeParse({
      debitedAccountId,
      creditUsername,
      transactionValue,
    });
    if (!parsed.success) {
      throw new AppError(400, "Invalid transaction schema");
    }

    const userToCredit = await prisma.users.findUnique({
      where: { username: creditUsername },
      include: { account: true },
    });
    if (!userToCredit) throw new AppError(404, "Credit account not found");

    const accountToDebit = await prisma.accounts.findUnique({
      where: { id: debitedAccountId },
    });
    if (!accountToDebit) throw new AppError(404, "Debit account not found");
    if (accountToDebit.id === userToCredit.accountId) {
      throw new AppError(
        401,
        "Debit account must be different from credit account"
      );
    }

    if (transactionValue > accountToDebit.balance)
      throw new AppError(401, "Insufficient funds");

    await prisma.$transaction([
      prisma.transactions.create({
        data: {
          debitedAccountId,
          creditedAccountId: userToCredit.accountId,
          value: transactionValue,
        },
      }),
      prisma.accounts.update({
        where: { id: debitedAccountId },
        data: { balance: accountToDebit.balance - transactionValue },
      }),
      prisma.accounts.update({
        where: { id: userToCredit.accountId },
        data: { balance: userToCredit.account.balance + transactionValue },
      }),
    ]);
  }
}

import * as z from "zod";

export const CreateTransactionSchema = z.object({
  debitedAccountId: z.string().uuid(),
  creditUsername: z.string().min(3),
  transactionValue: z.number().gt(0),
});

export type ICreateTransactionDTO = z.infer<typeof CreateTransactionSchema>;

