import { hash } from "bcryptjs";
import { sign } from "jsonwebtoken";

import { prisma } from "../../../database/prismaClient";
import { AppError } from "../../../errors/AppError";
import { IUserDTO, UserSchema } from "../../dtos/IUserDTO";

export class CreateUserUseCase {
  async execute({ username, password }: IUserDTO) {
    const parsed = UserSchema.safeParse({ username, password });
    if (!parsed.success) {
      throw new AppError(400, "Invalid user schema");
    }

    const userAlreadyExists = await prisma.users.findUnique({
      where: { username },
    });
    if (userAlreadyExists) throw new AppError(400, "User already exists");

    const passwordHash = await hash(password, 8);

    const newUser = await prisma.users.create({
      data: {
        username,
        password: passwordHash,
        account: {
          create: {
            balance: 100,
          },
        },
      },
    });

    const token = sign(
      { username, accountId: newUser.accountId },
      process.env.JWT_SECRET as string,
      {
        expiresIn: "24h",
      }
    );

    return { token };
  }
}

import * as z from "zod";

export const UserSchema = z.object({
  username: z.string().min(3),
  password: z
    .string()
    .min(8)
    .regex(/.*[A-Z].*/, "One uppercase character")
    .regex(/.*\d.*/, "One number"),
});

export type IUserDTO = z.infer<typeof UserSchema>;

import { Request, Response } from "express";

import { GetTransactionsUseCase } from "./GetTransactionsUseCase";

export class GetTransactionsController {
  async handle(req: Request, res: Response) {
    const getTransactionsUseCase = new GetTransactionsUseCase();
    const result = await getTransactionsUseCase.execute(
      req.accountId as string
    );
    res.status(200).json(result);
  }
}

import { prisma } from "../../../database/prismaClient";

export class GetTransactionsUseCase {
  async execute(accountId: string) {
    const transactions = await prisma.transactions.findMany({
      where: {
        OR: [{ creditedAccountId: accountId }, { debitedAccountId: accountId }],
      },
      orderBy: [{ createdAt: "desc" }],
      select: {
        id: true,
        value: true,
        createdAt: true,
        creditedAccountId: true,
        debitedAccountId: true,
        creditAccount: {
          select: {
            Users: {
              select: {
                username: true,
              },
            },
          },
        },
        debitAccount: {
          select: {
            Users: {
              select: {
                username: true,
              },
            },
          },
        },
      },
    });

    return transactions.map((transaction) => {
      if (transaction.creditedAccountId === accountId) {
        return {
          id: transaction.id,
          type: "credit",
          value: transaction.value,
          username: transaction.debitAccount.Users?.username,
          createdAt: transaction.createdAt,
        };
      }
      return {
        id: transaction.id,
        type: "debit",
        value: -Math.abs(transaction.value),
        username: transaction.creditAccount.Users?.username,
        createdAt: transaction.createdAt,
      };
    });
  }
}

